import React from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Import Bootstrap CSS
import "./staff.css";

const event1 = () => {
  const scrollToSection = (sectionId) => {
    document.getElementById(sectionId).scrollIntoView({ behavior: 'smooth' });
  };
  return (
    <div className='event1'>
    <p className='text-center info'>IT STAFF AUGMENTATION SERVICES
    </p>
    <h1 className='text-center'>Now you don't have to  
    <strong> hire, train and manage </strong> 
    an entire in-house development team</h1>
    <p className='text-center event1end'>Specialists for hard-to-fit positions. Based in US time zones.</p>
    <div className="row justify-content-md-center">
    <button className="button" onClick={() => scrollToSection('section2')}><span className='message'>Leave us a message</span>
    <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" fill="currentColor" className="bi bi-arrow-up-right-circle" viewBox="0 0 16 16">
  <path fill-rule="evenodd" d="M1 8a7 7 0 1 0 14 0A7 7 0 0 0 1 8m15 0A8 8 0 1 1 0 8a8 8 0 0 1 16 0M5.854 10.803a.5.5 0 1 1-.708-.707L9.243 6H6.475a.5.5 0 1 1 0-1h3.975a.5.5 0 0 1 .5.5v3.975a.5.5 0 1 1-1 0V6.707z"/>
</svg>
    </button>
    </div>
    </div>
  );
}

export default event1;

